// src/pages/Home.js
import React from 'react';
import './Home.css';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import { Carousel } from 'react-bootstrap';
import { useSpring, animated, config } from 'react-spring';
import { useInView } from 'react-intersection-observer';

function Home() {
  // Efek parallax untuk galeri dan deskripsi
  const [galleryRef, galleryInView] = useInView({
    triggerOnce: true,
  });

  const [descriptionRef, descriptionInView] = useInView({
    triggerOnce: true,
  });

  const gallerySpring = useSpring({
    from: { opacity: 0, transform: 'translateY(100px)' },
    to: { opacity: 1, transform: 'translateY(0)' },
    config: { duration: 500 },
  });

  const descriptionSpring = useSpring({
    from: { opacity: 0, transform: 'translateY(100px)' },
    to: { opacity: 1, transform: 'translateY(0)' },
    config: { duration: 500 },
  });

  const rotateSpring = useSpring({
    from: { transform: 'rotate(0deg)' },
    to: { transform: 'rotate(360deg)' },
    config: { duration: 2000, easing: config.molasses },
  });

  return (
    <div className="page">
      <h2>Welcome to Data Profile</h2>
      <p>This is a simple data profile website built with React.js.</p>

      <Carousel>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src="https://via.placeholder.com/800x400"
            alt="First slide"
          />
          <Carousel.Caption>
            <h3>First Slide</h3>
            <p>Some text about the first slide.</p>
          </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item>
          <img
            className="d-block w-100"
            src="https://via.placeholder.com/800x400"
            alt="Second slide"
          />
          <Carousel.Caption>
            <h3>Second Slide</h3>
            <p>Some text about the second slide.</p>
          </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item>
          <img
            className="d-block w-100"
            src="https://via.placeholder.com/800x400"
            alt="Third slide"
          />
          <Carousel.Caption>
            <h3>Third Slide</h3>
            <p>Some text about the third slide.</p>
          </Carousel.Caption>
        </Carousel.Item>
      </Carousel>

      <animated.div ref={galleryRef} style={gallerySpring} className="gallery">
        <h3>My Portfolio</h3>
        <div className="gallery-images">
          <animated.img
            style={rotateSpring}
            src="https://via.placeholder.com/200"
            alt="Project 1"
          />
          <animated.img
            style={rotateSpring}
            src="https://via.placeholder.com/200"
            alt="Project 2"
          />
          <animated.img
            style={rotateSpring}
            src="https://via.placeholder.com/200"
            alt="Project 3"
          />
          {/* ... Add more images as needed */}
        </div>
      </animated.div>

      <animated.div
        ref={descriptionRef}
        style={descriptionSpring}
        className="description"
      >
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua.
        </p>
        <p>
          Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris
          nisi ut aliquip ex ea commodo consequat.
        </p>
      </animated.div>
    </div>
  );
}

export default Home;
